import React, { Component } from "react";
import Header from "./Header";
import Homepage from "./Homepage";

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render(){
    let langs = ["Ruby","ES6","Scala"]
      return (<div>
        {langs.map(it => <p>{it}</p>)}
      </div>)
  }
}

export default App;
